%% Phase averaging of instantaneous spatial data (for periodic signals) having well-defined phase

clc
clear

%%
set(groot,'defaultAxesTickLabelInterpreter','latex');
set(groot,'defaultLegendInterpreter','latex');
set(groot, 'defaultAxesTickDir', 'out');
set(groot,  'defaultAxesTickDirMode', 'manual');

delay_time_uncoupled = [413.91 ;324.02 ;324.02 ;82.32 ;65.46 ;64.29 ;...
    69.62 ;32.39 ;124.32 ;413.25 ;98.73 ;389.34];
delay_time_coupled = [498.3; 320.23; 320.23; 71.18; 320.23; 320.23; 320.23;...
    320.23; 320.23; 320.23; 320.23; 320.23]; % camera delay times for uncoupled and coupled image datasets (in microseconds)

% mycolormap  = customcolormap(linspace(0,1,5), {'#a60026','#f66e44','#ffffbd','#73add2','#313691'});
% mycolormap2 = customcolormap(linspace(0,1,9), {'#b35806','#e08214','#fdb863','#fee0b6','#f7f7f7','#d8daeb','#b2abd2','#8073ac','#542788'});

length_coupling         = 100; % length of coupling tube (in cm)

if length_coupling ~= 215 % counter number for loops involving all lengths
    length_data_counter   = (length_coupling-90)/10;
else
    length_data_counter = 12;
end

Camera_dataset_Folder   = '/media/ankit/My Book/Ankit Sahay/Lab System/Self_coupling_TARA_data/TARA/Experiments/Camera_Data_Sets/';
Length_name             = sprintf('%d cm',length_coupling);
Length_folder           = ([Camera_dataset_Folder Length_name '/']);
Pressure_folder         = 'Pressure';
pres_data_Folder        = ([Length_folder Pressure_folder '/']);

Image_folder            = '/media/ankit/My Book/Ankit Sahay/Lab System/Self_coupling_TARA_data/TARA/Tiff images/'; % Folder containing tiff images
Image_data_folder       = ([Image_folder Length_name '/']);
Coupling_status         = 'Before coupling';
Image_data_folder       = ([Image_data_folder Coupling_status '/Test1/1_Cam_8726_Cine1/']); % Cine1 - Uncoupled, Cine2 - Coupled
Chemiimgname            = 'Img';

file_num                = 1; % 1 - Uncoupled, 2 - Coupled
file_name               = sprintf('%d.txt', file_num);
pres_data               = load([pres_data_Folder, file_name]);
p_near                  = pres_data(:,3)*1000/0.2134; % taking 3rd row pressure data (close to dump plane)
pf_near                 = p_near - mean(p_near);
pnear_frms              = rms(pf_near);

total_time              = 3;
fs_pres                 = 10000; % Sampling frequency for pressure data 
fs_img                  = 2000;  % Sampling frequency for high-speed imaging
sktime                  = 1/fs_pres; 
sktime_micros           = sktime*1000000; % 1000000 becuase camera delay time is in microseconds
fs_pres_to_fs_img_ratio = fs_pres/fs_img; 
time_actual             = sktime:sktime:total_time; % 1st pressure data starts from 1/fspres time, not t=0 

cam_delay               = delay_time_coupled(length_data_counter); % Pick delay time (coupled or uncoupled) according to the length of coupling tube used
cam_delay_s             = cam_delay * 1e-6; % Convert microseconds to seconds
skip_data_points        = ceil(cam_delay_s * fs_pres); % Number of initial pressure data points to be skipped to align pressure and first image data point

time_skip               = time_actual(skip_data_points:fs_pres_to_fs_img_ratio:end); % time array starting from 1st image, and skipping pressure points
pf_near_raw             = pf_near(skip_data_points:end); % pressure data starting from first image data point
pf_near_skip            = pf_near_raw(1:fs_pres_to_fs_img_ratio:end); % pressure data aligned with image data
pf_near_skip_norm       = pf_near_skip./std(pf_near_skip); % Normalizing pressure values

Length_name             = sprintf('%d cm',length_coupling);
Length_folder           = ([Camera_dataset_Folder Length_name '/']);

PMT_folder              = 'HRR'; % Extrcating and arranging PMT data
pmt_data_Folder         = ([Length_folder PMT_folder '/']);
pmt_data                = load([pmt_data_Folder, file_name]);
pmt                     = pmt_data(:,2);
pmtf                    = pmt - mean(pmt);
pmtf_raw                = pmtf(skip_data_points:end);
pmtf_skip               = pmtf_raw(1:fs_pres_to_fs_img_ratio:end);

row_image               = 574; % Number of rows in final image
col_image               = 764; % Number of columns in final image
tot_matrix_size         = row_image*col_image;

%% Time series of p' and instants of camera data acquired

strtpt          = 1;
no_of_image_pts = 1050;
plim            = 7000; % Change this axis limit value for proper visualization
qlim            = 2;    % Change this axis limit value for proper visualization
figure(2)
plot(time_skip(strtpt:strtpt + no_of_image_pts),...
    pf_near_skip(strtpt:strtpt + no_of_image_pts),'-o'...
    ,'MarkerFaceColor','red')
xlim([time_skip(strtpt) time_skip(strtpt + no_of_image_pts)])
ylim([-plim plim])

%% Calculate phase using Hilbert Transform

p1_p_skip              = hilbert(pf_near_skip);
phase_p_skip_unwrapped = unwrap(angle(p1_p_skip));
phase_p_skip_wrapped   = rad2deg(wrapTo2Pi(phase_p_skip_unwrapped));

%% Show time series of p', camera data points, and corresponding phase time series

ax1 = subplot(211);
plot(time_skip(strtpt:strtpt + no_of_image_pts),...
    pf_near_skip(strtpt:strtpt + no_of_image_pts),'-o'...
    ,'MarkerFaceColor','red')
xlim([time_skip(strtpt) time_skip(strtpt + no_of_image_pts)])
ylim([-plim plim])

ax2 = subplot(212);
plot(time_skip(strtpt:strtpt + no_of_image_pts),...
    phase_p_skip_wrapped(strtpt:strtpt + no_of_image_pts),'-o'...
    ,'MarkerFaceColor','red')
xlim([time_skip(strtpt) time_skip(strtpt + no_of_image_pts)])
% ylim([-180 180])
hold on;
linkaxes([ax1 ax2],'x')

%% Find points corresponding to phases (+/- phase_margin degrees)

phase_margin_000 = 2.5; % -2.5 degrees to 2.5 degrees
phase_margin_045 = 3.2; % 41.8 degrees to 48.2 degrees
phase_margin_090 = 3.5; % and so on...
phase_margin_135 = 4;
phase_margin_180 = 3.5;
phase_margin_225 = 3;
phase_margin_270 = 3.5;
phase_margin_315 = 4;

indices_considered         = strtpt:strtpt + no_of_image_pts;
phase_considered           = phase_p_skip_wrapped(indices_considered);
time_considered            = time_skip(indices_considered);
logicalIndexes_phase_zero1 = (phase_considered > 0) & (phase_considered < phase_margin_000);
logicalIndexes_phase_zero2 = (phase_considered > 360-phase_margin_000) & (phase_considered < 360);
linearIndexes_phase_zero1  = find(logicalIndexes_phase_zero1);
linearIndexes_phase_zero2  = find(logicalIndexes_phase_zero2);
phase_000_index            = sort([linearIndexes_phase_zero1 ; linearIndexes_phase_zero2]);

logicalIndexes_phase_45    = (phase_considered > 45-phase_margin_045) & (phase_considered < 45+phase_margin_045);
phase_045_index            = find(logicalIndexes_phase_45);

logicalIndexes_phase_90    = (phase_considered > 90-phase_margin_090) & (phase_considered < 90+phase_margin_090);
phase_090_index            = find(logicalIndexes_phase_90);

logicalIndexes_phase_135   = (phase_considered > 135-phase_margin_135) & (phase_considered < 135+phase_margin_135);
phase_135_index            = find(logicalIndexes_phase_135);

logicalIndexes_phase_180   = (phase_considered > 180-phase_margin_180) & (phase_considered < 180+phase_margin_180);
phase_180_index            = find(logicalIndexes_phase_180);

logicalIndexes_phase_225   = (phase_considered > 225-phase_margin_225) & (phase_considered < 225+phase_margin_225);
phase_225_index            = find(logicalIndexes_phase_225);

logicalIndexes_phase_270   = (phase_considered > 270-phase_margin_270) & (phase_considered < 270+phase_margin_270);
phase_270_index            = find(logicalIndexes_phase_270);

logicalIndexes_phase_315   = (phase_considered > 315-phase_margin_315) & (phase_considered < 315+phase_margin_315);
phase_315_index            = find(logicalIndexes_phase_315);

%% View camera data points corresponding to phases obtained in the previous section


plot(1:no_of_image_pts, pf_near_skip(1:no_of_image_pts),'-')
hold on;
for counter = 1:length(phase_000_index)
    plot(phase_000_index(counter), pf_near_skip(phase_000_index(counter)),...
        'o','MarkerFaceColor','red','MarkerSize',12)
end
for counter = 1:length(phase_045_index)
    plot(phase_045_index(counter), pf_near_skip(phase_045_index(counter)),...
        's','MarkerFaceColor','blue','MarkerSize',12)
end

for counter = 1:length(phase_090_index)
    plot(phase_090_index(counter), pf_near_skip(phase_090_index(counter)),...
        'd','MarkerFaceColor','black','MarkerSize',12)
end

for counter = 1:length(phase_135_index)
    plot(phase_135_index(counter), pf_near_skip(phase_135_index(counter)),...
        'h','MarkerFaceColor','magenta','MarkerSize',12)
end

for counter = 1:length(phase_180_index)
    plot(phase_180_index(counter), pf_near_skip(phase_180_index(counter)),...
        'o','MarkerFaceColor','magenta','MarkerSize',12)
end

for counter = 1:length(phase_225_index)
    plot(phase_225_index(counter), pf_near_skip(phase_225_index(counter)),...
        's','MarkerFaceColor','red','MarkerSize',12)
end

for counter = 1:length(phase_270_index)
    plot(phase_270_index(counter), pf_near_skip(phase_270_index(counter)),...
        'd','MarkerFaceColor','blue','MarkerSize',12)
end

for counter = 1:length(phase_315_index)
    plot(phase_315_index(counter), pf_near_skip(phase_315_index(counter)),...
        'h','MarkerFaceColor','black','MarkerSize',12)
end

xlim([1 no_of_image_pts])
%% Calculate mean of chemi images

for counter = 1:500 % Mean being taken of 500 images
    counter
    FileStr_for_mean      = sprintf('%06d.tif', counter);
    dataname_for_mean     = strcat(Image_data_folder,...
        Chemiimgname, FileStr_for_mean);
    Chemi_file_for_mean   = importdata(dataname_for_mean);
    Chemi_double_for_mean = double(Chemi_file_for_mean);
    
    % Mask bluff body region
    Chemi_double_for_mean(319:421,1:185)   = 0;
    Chemi_double_for_mean(216:529,185:262) = 0;
    Chemi_double_for_mean(:,765:end)       = [];
    
    % Crop the outer boundaries
    Chemi_double_for_mean(1:73,:)       = [];
    Chemi_double_for_mean(end-72:end,:) = [];
    
    Chemi_double_reshaped_for_mean(:,counter) ...
        = reshape(Chemi_double_for_mean,tot_matrix_size,1); % reshape the image matrix into columns. 
                                                            % Each column
                                                            % corresponds
                                                            % to one time
                                                            % instant
end

mean_chemi = mean(Chemi_double_reshaped_for_mean,2); % taking mean of each pixel (over time)
std_chemi = std(Chemi_double_reshaped_for_mean,0,2); % taking standard deviation (over time)
clear Chemi_double_reshaped_for_mean

%% Claculate normalized fluctuations of chemi data. uses function phase_averaging.m

[phase_avgd_chemi_000_reshaped, phase_avgd_pq__000_reshaped] ...
    = phase_averaging(phase_000_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_045_reshaped, phase_avgd_pq__045_reshaped] ...
    = phase_averaging(phase_045_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_090_reshaped, phase_avgd_pq__090_reshaped] ...
    = phase_averaging(phase_090_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_135_reshaped, phase_avgd_pq__135_reshaped] ...
    = phase_averaging(phase_135_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_180_reshaped, phase_avgd_pq__180_reshaped] ...
    = phase_averaging(phase_180_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_225_reshaped, phase_avgd_pq__225_reshaped] ...
    = phase_averaging(phase_225_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_270_reshaped, phase_avgd_pq__270_reshaped] ...
    = phase_averaging(phase_270_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

[phase_avgd_chemi_315_reshaped, phase_avgd_pq__315_reshaped] ...
    = phase_averaging(phase_315_index, Image_data_folder, Chemiimgname,...
    tot_matrix_size, mean_chemi, std_chemi, pf_near_skip_norm, row_image, col_image);

